import React, { Component, useState, useEffect } from 'react';
import { Text, View, StyleSheet, Button, TouchableOpacity } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import LogList from './LogPage_component/LogList';
import { ScrollView } from 'react-native';

//screens
import AddFood from './AddFood';
import ManualEntry from './LogPage_component/ManulLogToDB';
import BarcodeEntry from './LogPage_component/BarcodeEntry';
import { add } from 'react-native-reanimated';
import FoodInput from './LogPage_component/FoodInput';






function LogPage({ navigation, route }) {
    const[breakFast, setBreakFast] = useState([{value: 'Eggs', serving: 2}, {value: 'Orange Juice', serving: 1}]);
    const[lunch, setLunch] = useState([{value: 'Rice', serving: 2}, {value: 'Chicken', serving: 1}]);
    const[dinner, setDinner] = useState([{value: 'Steak', serving: 3}, {value: 'mash potato', serving: 1}]);
    const[snacks, setSnacks] = useState([{value: 'Peas', serving: 5}, {value: 'Carrots', serving: 2}]);

    const myProp = route.params ? route.params : false;
    console.log(myProp)
    if(myProp)
    {
        //setBreakFast([...breakFast, myProp])
        console.log(myProp)
    }

    const addBreakFast = (text) =>
    {
        const newItem = {value: text};
        setBreakFast([...breakFast, newItem])
    }

    // when 'AddFood' button is pressed
    const onPressed = () => {
        navigation.navigate('AddFood')
    }

    return (
        <ScrollView contentContainerStyle={{ padding: 10 }}>
            <View style={{ flex: 1 }}>


                <Text style={[styles.Text]}>BreakFast</Text>
                <LogList data={breakFast} />
                <View style={styles.button}><Button title={'Add Food'} onPress={onPressed} /></View>

                <Text style={[styles.Text, { marginTop: 20 }]}>Lunch</Text>
                <LogList data={lunch} />
                <View style={styles.button}><Button title={'Add Food'} titleStyle={{ fontSize: 50 }} onPress={onPressed} /></View>

                <Text style={[styles.Text, { marginTop: 20 }]}>Dinner</Text>
                <LogList data={dinner} />
                <View style={styles.button}><Button title={'Add Food'} titleStyle={{ fontSize: 50 }} onPress={onPressed}/></View>

                <Text style={[styles.Text, { marginTop: 20 }]}>Snacks</Text>
                <LogList data={snacks} />
                <View style={styles.button}><Button title={'Add Food'} titleStyle={{ fontSize: 50 }} onPress={onPressed} /></View>

                {/* <Text style={[styles.AddFoodManually, { marginTop: 20 }]}>Add Food Manually</Text> */}
                {/*
                <TouchableOpacity style={styles.AddFoodManually}>
                    <Text style={styles.buttonText}>Add</Text>
                </TouchableOpacity>
                */}



            </View>
        </ScrollView>

    );
}

const Stack = createNativeStackNavigator();

function StackNav() {
    return (

        <NavigationContainer independent={true}>
            <Stack.Navigator initialRouteName='LogPage' >
                <Stack.Screen name='LogPage' component={LogPage} options={{ headerShown: false }} />
                <Stack.Screen name='AddFood' component={AddFood} />
                <Stack.Screen name='ManualEntry' component={ManualEntry}/>
                <Stack.Screen name='BarcodeEntry' component={BarcodeEntry}/>
                <Stack.Screen name='FoodInput' component={FoodInput} />
            </Stack.Navigator>
        </NavigationContainer>

    );

}


const styles = StyleSheet.create({
    Text:
    {
        fontWeight: 'bold',
        fontSize: 30,
        backgroundColor: 'white',
        padding: 10
    },

    Link:
    {
        fontWeight: 'bold',
        fontSize: 30,
        color: 'blue',
        marginLeft: 10,
        marginTop: 1,
        backgroundColor: 'white'
    },

    button:
    {
        alignItems: 'flex-start',
        backgroundColor: 'white',
        marginTop: 2,
    },

    // add addFood manully styling - start
    AddFoodManually: {
        justifyContent:'center',
        paddingTop:20,
        marginBottom:40,
        fontWeight: 'bold',
        fontSize: 20,
        backgroundColor: 'white',
        borderRadius: 50,
        width:'7%',
        height:'10%',
        alignContent:'center',
    },
    buttonText: {
        fontSize: 33,
        fontWeight: 'bold',
        textAlign:'center',
    }
    // add addFood manully styling - end


});

export default StackNav;
